var msgObserver;
var interactionObserver;
var lastMsg;
var chatDiv;
var chimeOnInternal = true;
var chimeOnExternal = true;

function oLog(msg) {
    console.log(`VCC Chime Extension: ${msg}`);
}

function onError(error) {
    oLog(`Error: ${error}`);
}

function loadOptions(result) {
    chimeOnExternal = result.extNot;
    chimeOnInternal = result.intNot;
}

function updateOptions(changes, areaName) {
    if ('extNot' in changes) {
        chimeOnExternal = changes['extNot'].newValue;
    }
    if ('intNot' in changes) {
        chimeOnInternal = changes['intNot'].newValue;
    }
    oLog("Updated extension preferences");
    ensureExtension();
}

function checkNewMessage(mutationList, observer) {
    var msg = chatDiv.lastElementChild;
    if (!msg.isEqualNode(lastMsg)) {
        lastMsg = msg;
        if (chimeOnInternal && msg.classList.contains('message-local')) {
            oSnd.play();
            oLog("Local message notified");
        } else if (chimeOnExternal && msg.classList.contains('message-external')) {
            oSnd.play();
            oLog("External message notified");
        } else {
            oLog("New message doesn't meet chime requirements");
        }
    }
}

function startMessageWatching() {
    oLog("Initializing notifications for current chat");
    var chats = document.getElementsByClassName('chat-conversation-view');
    if (chats.length < 1) {
        oLog("Couldn't find chat window");
        return;
    }
    chatDiv = chats[0];
    const config = {attributes: false, childList: true, subtree: false};
    msgObserver.observe(chatDiv, config); // constructed in initializeExtension()
}

function interactionCallback(mutationList, observer) {
    oLog("Interaction callback fired");
    try {  // Disconnect old observer if needed
        msgObserver.disconnect();
    } catch (error) {
        oLog("No previous message observer to disconnect");
    }
    startMessageWatching();
}

function initializeExtension() {
    oLog("Initializing extension");
    let getting = browser.storage.local.get({
        extNot: true,
        intNot: false
    });
    getting.then(loadOptions, onError);

    browser.storage.local.onChanged.addListener(updateOptions);

    var interactions = document.getElementsByClassName('interaction-viewer');
    if (interactions.length < 1) {
        oLog("Couldn't find interactions window");
        // Try again in 5s
        setTimeout(ensureExtension, 5000);
        return;
    }
    interactionsDiv = interactions[0];
    interactionObserver = new MutationObserver(interactionCallback);
    const config = {attributes: false, childList: true, subtree: false};
    interactionObserver.observe(interactionsDiv, config);

    msgObserver = new MutationObserver(checkNewMessage);

    startMessageWatching(); // Just in case you already can do this at the start
}

function ensureExtension() {
    if (typeof interactionObserver !== 'object') {
        oLog("Looks like we haven't initialized yet, fix that");
        initializeExtension();
    }
}

const oSnd = new Audio("data:audio/x-wav;base64,");

document.addEventListener('DOMContentLoaded', initializeExtension);
setTimeout(ensureExtension, 2000);
